import React from 'react';

function App() {
  const handleModelLogin = () => {
    alert('Model login clicked!');
  };

  const handleClientLogin = () => {
    alert('Client login clicked!');
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>Welcome to the Model Matching Site</h1>
      <p>Please choose your login type:</p>
      <div>
        <button
          onClick={handleModelLogin}
          style={{
            margin: '10px',
            padding: '10px 20px',
            fontSize: '16px',
            cursor: 'pointer',
          }}
        >
          Login for Models
        </button>
        <button
          onClick={handleClientLogin}
          style={{
            margin: '10px',
            padding: '10px 20px',
            fontSize: '16px',
            cursor: 'pointer',
          }}
        >
          Login for Clients
        </button>
      </div>
    </div>
  );
}

export default App;
